import FooterContent from './FooterContent';
import ContactForm from './ContactForm.jsx';

function Contact(){

    return (
        <div>
            <h3 className = "getInTouch">GET IN TOUCH WITH US!</h3>
            <p className = "getInTouch">We're open for any suggestions or just to have a chat.</p>
            <FooterContent class = "fas fa-phone getInTouch" cName = "getInTouch" text = "+91 99452 58005"/>
            <FooterContent class = "fas fa-envelope getInTouch" cName = "getInTouch" text = "laddoos@ymail.com"/>
            <ContactForm />
            <div className = "contactBottomContainer"></div>
        </div>
        );
}

export default Contact;
